    <main>
      <h1 className="cat-title">All Categories</h1>
      {!choose && (
        <div className="category-container">
          <div>
            <h4>Kevin</h4>
          </div>
          <div>
            <h4>Kristóf</h4>
          </div>
          <div>
            <h4>Bálint</h4>
